import React from 'react'
import "./Profile.css";
import Sidenav from './navigation/Sidenav';
const Profile = ()=>{
    return (
        <div className="app">

      <Router>
        <Routes>

          <Route path="/Sidenav" element={<Sidenav/>} />
          <Route path="/Mypro" element={<Mypro/>} />
        </Routes>
      </Router>
     
    </div>
        
        
  );
}

export default Profile
